import React from 'react';
import './style.css'
import { Link } from 'react-router-dom';
import { Image } from 'react-styled-components'

const Promocoes = () => {
    return (
        <article class="container page_body">
            <h1>Promoções</h1>
                       
            <Link  to="/cadastrar"className='btn btn-light'>Cadastrar Cupom &raquo;</Link>
            

            <img src='imgBrasilia.jpg' className="col-md-5"/>
        
        
        </article>
    );
}

export default Promocoes;
